    { name: 'Ambiguity Tolerance', symbol: '⏳', definition: 'Definition of Ambiguity Tolerance' },
    { name: 'Conflict Avoidance', symbol: '🚫', definition: 'Definition of Conflict Avoidance' },
    { name: 'Conflict Resolution', symbol: '⚖️', definition: 'Definition of Conflict Resolution' },
    { name: 'Empathy', symbol: '❤️', definition: 'Definition of Empathy' },
    { name: 'Cultural Competence', symbol: '🌍', definition: 'Definition of Cultural Competence' },
    { name: 'Advising and Instruction', symbol: '📚', definition: 'Definition of Advising and Instruction' },
    { name: 'Paraphrasing', symbol: '🔄', definition: 'Definition of Paraphrasing' },
    { name: 'Negotiation', symbol: '💼', definition: 'Definition of Negotiation' },
    { name: 'Debate', symbol: '🗣️', definition: 'Definition of Debate' },
    { name: 'Behavioral Counseling', symbol: '🧠', definition: 'Definition of Behavioral Counseling' },
    { name: 'Assertive Communication', symbol: '🗨️', definition: 'Definition of Assertive Communication' },
];

